webpackJsonp([0x6b74f6c28aff],{486:function(e,o){e.exports={data:{markdownRemark:{html:'<p>We can help with every aspect of your Interior Design requirements for the home.</p>\n<p>We can help with large or smaller projects including complete renovations and refurbishments.</p>\n<p>We can provide you with scale floor plans, elevations, lighting plans, and help you coordinate your works.</p>\n<p>If your project is purely decorative we can develop design schemes and provide all the elements required from wall coverings to soft furnishings to flooring and lighting.</p>\n<p>We tailor our Design Schemes to suit your tastes and to create a home which is not just attractive to look at but you will also feel comfortable to live in.</p>\n<p>We can create stunning Contemporary Interiors as well as Stylish Elegant more Classic Interiors.</p>\n<p>Alternatively you may just be looking for that one lamp or rug to finish off your own schemes.</p>\n<p>We carry a large range of top fabrics, lighting, rugs and furniture - <a href="/products">see our products page</a>.</p>',frontmatter:{date:null,slug:"domestic",title:"Domestic Interiors"}},allMarkdownRemark:{edges:[{node:{frontmatter:{title:"Modern House in Berkshire",cover:"dom7splash.jpg",slug:"2014-modern-house"}}},{node:{frontmatter:{title:"Victorian Country House in Rode, Somerset",cover:"dom1r.jpg",slug:"2012-victorian-country-house"}}},{node:{frontmatter:{title:"Period Cottage near Bath",cover:"dom2o.jpg",slug:"2011-period-cottage"}}},{node:{frontmatter:{title:"Contemporary House in Bath",cover:"dom3f.jpg",slug:"2009-contemporary-house"}}},{node:{frontmatter:{title:"Georgian Apartment in Sydney Place, Bath",cover:"dom4j.jpg",slug:"2008-georgian-apartment"}}},{node:{frontmatter:{title:"Converted Victorian School near Winchester",cover:"dom5i.jpg",slug:"2004-converted-victorian-school"}}}]}},pathContext:{}}}});
